import React from 'react'

export default function About() {
    return (
        <React.Fragment>
            <h1>About</h1>
        
            <p> This is the TodoList app</p><br/>
            <p> This app was entirely made with react framework. </p><br/>
            <p> The data are avaiable at the todoData page of the server</p><br/>
            <p> https://afternoon-thicket-04912.herokuapp.com/todoData.html</p>
        </React.Fragment>
    )
}
